import {Component, Input} from '@angular/core';
import {ClassificationService} from '../../shared/services/classification.service';
import {Position} from '../../shared/models/position';
import {ActivatedRoute} from '@angular/router';
import {map, tap} from 'rxjs/operators';
import * as pdfmake from 'pdfmake/build/pdfmake';
import * as pdfFonts from 'pdfmake/build/vfs_fonts';
import {Location} from '@angular/common';


@Component({
    selector: 'app-position-course-detail',
    templateUrl: './position-course-detail.page.html',
    styleUrls: ['./position-course-detail.page.scss'],
})
export class PositionCourseDetailPage {
    // array of skill_ids to filter out


    positionId: number;
    positions: Position[] = [];

    constructor(
        private route: ActivatedRoute,
        private classificationService: ClassificationService,
        private location: Location) {
    }

    ionViewWillEnter() {
        this.positionId = +this.route.snapshot.paramMap.get('positionId');

        this.classificationService.getPositionDataFilteredBySkills(this.positionId, this.classificationService.skillsList).pipe(
            map((positions: Position[]) => {
                this.positions = Object.keys(positions)
                    .map(i => positions[i]);
            }))
            .subscribe();
    }

    onBackClick() {
        this.location.back();
    }

    makePDF() {

        const contentArray: any[] = [];

        for (const positionObject of this.positions) {
            // @ts-ignore
            for (const position of positionObject) {

                contentArray.push({
                    text: position.title,
                    style: 'positionHeader'
                });

                contentArray.push({
                    text: position.description + '\n\n',
                    style: 'courseStyle'
                });


                for (const skills of position.position_details) {
                    // Skills Title
                    const skill = {
                        text: skills.skill.title,
                        style: 'skillTitle'
                    };
                    contentArray.push(skill);
                    contentArray.push({
                        text: skills.skill.description + '\n\n',
                        style: 'courseStyle'
                    });
                    for (const details of skills.skill.skill_details) {

                        if (details.certification_id !== null) {
                            // Certifications
                            const cert_title = {
                                text: 'Certification',
                                style: 'certificationTitle'
                            };
                            contentArray.push(cert_title);

                            const cert = {
                                text: details.certification.title + '\n',
                                style: 'certificationTitle'
                            };
                            contentArray.push(cert);
                            for (const cert_details of details.certification.certification_details) {
                                const course = {
                                    text: cert_details.course.title,
                                    style: 'courseTitleStyle'
                                };
                                const course_description = {
                                    text: cert_details.course.description,
                                    style: 'courseStyle'
                                };

                                const course_url = {
                                    text: cert_details.course.url + '\n\n',
                                    style: 'courseStyle'
                                };

                                let item;
                                item = {
                                    table: {
                                        widths: [10, 'auto'],
                                        headerRows: 0,
                                        body: [
                                            [{}, course],
                                            [{}, course_description],
                                            [{}, course_url]
                                        ]
                                    }, layout: 'noBorders'
                                };

                                contentArray.push(item);
                            }
                        }

                        if (details.training_id !== null) {
                            const course_title = {
                                text: 'Courses',
                                style: 'certificationTitle'
                            };

                            contentArray.push(course_title);

                            for (const training_detail of details.training_detail.courses) {
                                const tcourse = {
                                    text: training_detail.title,
                                    style: 'courseTitleStyle'
                                };
                                const tcourse_description = {
                                    text: training_detail.description,
                                    style: 'courseStyle'
                                };

                                const tcourse_url = {
                                    text: training_detail.url + '\n\n',
                                    style: 'courseStyle'
                                };

                                let titem;
                                titem = {
                                    table: {
                                        widths: [10, 'auto'],
                                        headerRows: 0,
                                        body: [
                                            [{}, tcourse],
                                            [{}, tcourse_description],
                                            [{}, tcourse_url]
                                        ]
                                    }, layout: 'noBorders'
                                };

                                contentArray.push(titem);
                            }
                        }
                    }
                }


            }
        }

        const docDefinition = {
            pageSize: 'LETTER',
            pageMargins: [50, 120, 50, 80],
            header: {
                table: {
                    widths: [100, 'auto'],
                    headerRows: 0,
                    body: [
                        [{
                            image: 'data:image/png;base64,',
                            width: 100,
                            height: 100,
                            margin: [50, 10, 0, 0]
                        }, {
                            text: 'IT Certification & Training Management System',
                            alignment: 'left',
                            margin: [75, 50, 0, 0]
                        }]
                    ]
                }, layout: 'noBorders'
            },

            footer: function (currentPage, pageCount) {
                return {
                    text: '\u00A9' + '2019 - IT Executive Credential Program' + '\nPage ' + currentPage.toString() + ' of ' + pageCount,
                    alignment: 'center'
                };

            },
            content: [
                contentArray
            ],
            styles: {
                header: {
                    fontSize: 22,
                    bold: true
                },
                positionHeader: {
                    fontSize: 20,
                    bold: true
                },
                skillTitle: {
                    fontSize: 14,
                    bold: false
                },
                certificationTitle: {
                    fontSize: 12,
                    bold: false
                },
                courseStyle: {
                    fontSize: 10
                },
                courseTitleStyle: {
                    fontSize: 10,
                    bold: true
                }
            }
        };
        pdfmake.vfs = pdfFonts.pdfMake.vfs;

        // Microsoft Edge does not suppor this function so it must be downloaded as a workaround
        if (/Edge/.test(navigator.userAgent)) {
            pdfmake.createPdf(docDefinition).download();
        } else {
            pdfmake.createPdf(docDefinition).open();
        }


    }
}
